,p_query_type=>'SQL'
,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'WITH',
'    list_distance AS',
'        (select  round(ot.time_creat, ''MI'')  as data_order,',
'                 ot.order_taxi_id            as number_order,',
'                 p.name_passenger            as passenger,',
'                 s.status                    as status_order,',
'                 asot.from_address           as start_address,',
'                 w.from_address              as point_stop,',
'                 ot.end_trip_address_id      as trip_address',
'         from order_taxi ot',
'         left outer join passenger p',
'                      on ot.passenger_id = p.passenger_id',
'         left outer join status s',
'                      on ot.order_taxi_id = s.order_taxi_id',
'         left outer join (select order_taxi_id,',
'                                 from_address',
'                          from way',
'                          where preview_way_id is not null) w',
'                      on ot.order_taxi_id = w.order_taxi_id',
'         left outer join (select order_taxi_id,',
'                                 from_address',
'                          from way',
'                          where preview_way_id is null) asot',
'                      on ot.order_taxi_id = asot.order_taxi_id',
'         order by ot.time_creat desc),',
'         ',
'    list_address_point AS',
unistr('        (select data_order                                                       as \0412\0440\0435\043C\044F_\0417\0410\041A\0410\0417\0410,'),
unistr('                number_order                                                     as \041D\043E\043C\0435\0440_\0417\0410\041A\0410\0417\0410,'),
unistr('                passenger                                                        as \0418\043C\044F_\041F\0430\0441\0441\0430\0436\0438\0440\0430,'),
unistr('                status_order                                                     as \0421\0442\0430\0442\0443\0441_\0417\0410\041A\0410\0417\0410,'),
unistr('                start_address                                                    as \0410\0434\0440\0435\0441_\041D\0410\0427\0410\041B\0410,'),
unistr('                listagg(point_stop, ''; '') within group (order by point_stop)     as \0422\043E\0447\043A\0438_\043E\0441\0442\0430\043D\043E\0432\043A\0438,'),
unistr('                trip_address                                                     as \0410\0434\0440\0435\0441_\041E\041A\041E\041D\0427\0410\041D\0418\042F'),
'         from list_distance',
'         group by Number_order, data_order, passenger, status_order, start_address, trip_address)',
'',
'select *',
'from list_address_point',
unistr('order by \0412\0440\0435\043C\044F_\0417\0410\041A\0410\0417\0410;')))
